INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (4, 0.0, 119701, 0, 119701, 0, "2022/01/31 12:00:00", 0, 4, 0, 0, "2030/12/31 15:00:00", "シェフィ", 0, 0, 3, 0, 0, 0, 0, 0, "しぇふぃ", 0, "");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 2.17, 119901, 1, 119901, 119901, "2023/12/22 12:00:00", 0, 1, 302, 450, "2023/12/27 11:59:59", "ミヤコ（クリスマス）", 0, 14, 3, 0, 0, 0, 0, 119901, "みやこ", 1, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (5, 2.375, 120001, 1, 120001, 120001, "2024/03/22 12:00:00", 0, 5, 190, 450, "2024/03/28 11:59:59", "シズル（ノワール）", 0, 6, 3, 0, 0, 0, 0, 120001, "しずる", 1, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (7, 0.0, 120101, 0, 120101, 0, "2015/04/01 15:00:00", 0, 7, 0, 0, "2030/12/31 15:00:00", "イオ（ノワール）", 0, 0, 3, 0, 0, 0, 0, 0, "いお", 0, "");
