INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (7, 0.0, 120301, 0, 120301, 0, "2015/04/01 15:00:00", 0, 5, 0, 0, "2030/12/31 15:00:00", "シズル（ノワール）", 0, 0, 3, 0, 0, 0, 0, 0, "しずる", 0, "");
