INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (6, 2.22, 191301, 1, 191301, 191301, "2015/04/01 15:00:00", 0, 6, 850, 450, "2030/12/31 15:00:00", "カズマサ", 0, 0, 1, 0, 0, 0, 0, 191301, "かずまさ", 1, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (6, 0.0, 191401, 0, 191401, 0, "2015/04/01 15:00:00", 0, 6, 0, 0, "2030/12/31 15:00:00", "コッコロ", 0, 0, 0, 0, 0, 0, 0, 0, "こっころ", 0, "");
